def valid_extra_tag(tag: str) -> str:
    try:
        if tag[0] == '(':
            assert_valid_or_group(tag)
        elif tag.startswith('-('):
            validate_neg_and_group(tag)
        else:
            assert is_valid_extra_tag(tag[1:] if tag.startswith('-') else tag)
        return tag.lower().replace(' ', '_')
    except Exception:
        Log.fatal(f'Fatal: invalid tags group: \'{tag}\'!')
        raise ValueError


def valid_tags(tags_str: str) -> str:
    all_valid = True
    tag_ids = set()
    if len(tags_str) > 0:
        for tag in tags_str.split(','):
            try:
                assert len(tag) > 0
                assert_valid_tag(tag)
                tag_ids.add(get_tag_num(tag))
            except Exception:
                Log.error(f'Error: invalid tag: \'{tag}\'!')
                all_valid = False
                continue
    if not all_valid:
        Log.fatal('Fatal: Invalid tags found!')
        raise ValueError
    return ','.join(sorted(tag_ids))


